Estampe, Epreuve
Trente-sept éléments du portfolio sur trente-six feuilles pliées en deux :
Au début du portfolio : 
une page de titre ;
un texte typographié "Proclama" ;
un texte manuscrit (sur deux feuilles pliées en deux) ;
une version typographiée sur papier à en tête du texte manuscrit (sur deux feuillets (27,4 x 21,2 cm) ;
trente intercalaires pliés en deux mentionant le numéro et contenu de l'article de la déclaration universelle des droits de l'homme. 
A la fin du portfolio : 
un justificatif de tirage ;
un texte avec la liste des artistes ayants participé à ce portfolio ;
un texte avec la liste des imprimeurs ayants participé à ce portfolio.
Typographie sur papier
